var React = require('react');
var Component = React.Component;
var CanvasJS = CanvasJSReact.CanvasJS;
var CanvasJSChart = CanvasJSReact.CanvasJSChart;
var dataPoints = JSON.parse(myjsonstring);
class App extends Component {

	render() {	
		const options = {
			theme: "light2",
			title: {
				text: "Response time for 311 request by neighborhood"
			},
			axisY: {
				title: "Length of response time in days"
			},
			data: [{
				type: "bar",
				dataPoints: [
					{
						y: 6.796163069544365,
						label: "Allston"
					  },
					  {
						y: 6.275996112730807,
						label: "Allston / Brighton"
					  },
					  {
						y: 6.805792338502619,
						label: "Back Bay"
					  },
					  {
						y: 7.923076923076923,
						label: "Beacon Hill"
					  },
					  {
						y: 6.976805949008498,
						label: "Boston"
					  },
					  {
						y: 7.039119804400978,
						label: "Brighton"
					  },
					  {
						y: 8.7338504577823,
						label: "Charlestown"
					  },
					  {
						y: 4.117647058823529,
						label: "Chestnut Hill"
					  },
					  {
						y: 7.80894957734823,
						label: "Dorchester"
					  },
					  {
						y: 6.94489522960321,
						label: "Downtown / Financial District"
					  },
					  {
						y: 8.895958437352405,
						label: "East Boston"
					  },
					  {
						y: 8.156857060017396,
						label: "Fenway / Kenmore / Audubon Circle / Longwood"
					  },
					  {
						y: 8.084338624338624,
						label: "Greater Mattapan"
					  },
					  {
						y: 11.55770902138015,
						label: "Hyde Park"
					  },
					  {
						y: 6.823889739663094,
						label: "Jamaica Plain"
					  },
					  {
						y: 7.208542713567839,
						label: "Mattapan"
					  },
					  {
						y: 5.750145095763203,
						label: "Mission Hill"
					  },
					  {
						y: 6.401287271771969,
						label: "Roslindale"
					  },
					  {
						y: 5.858573094867807,
						label: "Roxbury"
					  },
					  {
						y: 3.4566582914572863,
						label: "South Boston"
					  },
					  {
						y: 4.399105196741998,
						label: "South Boston / South Boston Waterfront"
					  },
					  {
						y: 5.17442088091354,
						label: "South End"
					  },
					  {
						y: 6.549248969825867,
						label: "West Roxbury"
					  }
				]
			  }]
			}
		return (
		<div>
			<CanvasJSChart options = {options} 
				 onRef={ref => this.chart = ref}
			/>
			{/*You can get reference to the chart instance as shown above using onRef. This allows you to access all chart properties and methods*/}
		</div>
		);
	}

	componentDidMount(){
		var chart = this.chart;
		fetch('data/response_time.json')
		.then(function(response) {
			return response.json();
		})
		.then(function(data) {
			for (var i = 0; i < data.length; i++) {
				dataPoints.push({
					x: data[i].x,
					y: data[i].y
				});
			}
			chart.render();
		});
	}
}

export default App;
